  INSERT INTO projects (experience_id, name, description, objective, problem, solution, results, impact, stack, start_date, end_date, duration_months, collaborators, project_type, embedding) VALUES (exp_id_2, 'Caractrisation et classification de diffrences locales dtectes dans des collections d''images similaires', 'Construire une machine  collationner numrique pour identifier automatiquement les diffrences entre exemplaires numriss, aligner et comparer pages de diffrents exemplaires, classifier les types de diffrences dtectes, comprendre l''volution historique des textes.', 'Permettre aux historiens d''extraire automatiquement, par comparaison, les volutions contenues dans les 2000 ouvrages numriss durant le projet Bibliothques Virtuelles Humanistes du CESR.', 'Identifier et classifier automatiquement les diffrences entre exemplaires numriques de livres anciens (annotations, corrections, ajouts).', 'Chane de traitement : Phase Offline (Cration base d''apprentissage) : Prparation images, Cration couples d''images, Normalisation luminosit, Recalage d''image, Filtre gaussien, Calcul image des diffrences, Annotation manuelle 4 classes, Dcoupage patches 30x30, Extraction caractristiques. Phase Online (Classification) : Binarisation, Slection pixels, Classification (rouge = diffrence, bleu = bruit), Visualisation via IHM. Feature Engineering : GLCM (Gray-Level Co-occurrence Matrix), LBP (Local Binary Pattern), Moyenne et variance des voisinages, Intensit pixel. Architectures : CNN basiques, CNN Autoencoder (Siamese Network). Dataset : 34 872 patches (30x30 pixels), Classes : Ajout (13 783), Annotation manuscrite (2 645), Correction (1 211), Bruit (17 233), Regroupement final en 2 classes : Diffrence (17 639), Bruit (17 233).', 'Prsentation publique lors de la 5me journe annuelle du RTR Image, 5 juillet 2018  Blois. Prsentation : Vers un outil de collation numrique de livres anciens. valuation : Indice de Dice, Multiples indices de performance, Rsultats variables selon l''indice utilis.', 'Outil de recherche pour historiens, valorisation patrimoine numrique.', 'Keras (Deep Learning), Python, OpenCV (traitement d''images), QT (interface graphique existante)', '2018-01-01', '2018-06-30', 6, 'RFAI-LIFAT, CESR-BVH', 'R&D', '[0.0193786,-0.0716771,0.0107179,-0.0338289,-0.0157611,-0.0153081,0.0117656,-0.0259137,-0.0440083,-0.0000945,0.0085804,-0.0232785,-0.0612942,-0.0098385,-0.0112942,-0.0284305,-0.0031024,0.0185606,-0.0035867,0.0348935,-0.0180884,0.0036366,0.0129539,-0.0323202,-0.0314136,-0.0171974,0.0141120,-0.0049878,0.0240242,-0.0016344,-0.0301899,0.0004247,-0.0296429,-0.0383703,0.0180198,-0.0190733,-0.0171376,-0.0321345,-0.0277596,0.0417677,-0.0257844,-0.0506194,-0.0222697,0.0054710,-0.0118686,0.0247608,-0.0050096,0.0238244,-0.0003490,-0.0035347,-0.0133747,0.0139382,0.0116468,0.0420631,-0.0114086,0.0206218,-0.0007999,0.0127777,0.0032088,-0.0158416,-0.0103964,-0.0059871,0.0455511,0.0164046,-0.0187355,0.0042547,0.0037949,-0.0048951,-0.0370198,0.0169543,-0.0477563,0.0011878,0.0225540,0.0091982,0.0041397,-0.0021896,-0.0716538,0.0137842,-0.0484480,0.0081617,-0.0091369,0.0115762,0.0145978,0.0200832,-0.0627530,-0.0530649,0.0267349,0.0136772,0.0424366,0.0088677,-0.0047619,-0.0189008,0.0709195,-0.0358322,-0.0065738,0.0359824,-0.0025825,-0.0578608,0.0311199,0.0513732,-0.0132328,-0.0500754,0.0035837,0.0227008,0.0169478,-0.0144800,0.0066908,0.0144553,0.0182859,0.0074259,0.0140102,-0.0267564,-0.0122919,-0.0323470,0.0004341,0.0039345,0.0161272,-0.0569827,-0.0069919,0.0561678,0.0246895,-0.0049829,0.0803881,-0.0134199,-0.0007765,-0.0167516,0.0108229,-0.0521662,-0.0231952,0.0131071,-0.0336930,0.0186636,0.0112678,-0.0084443,0.0408969,-0.0262116,0.0064532,0.0093388,-0.0577490,-0.0329936,0.0063989,-0.0214592,-0.0126238,-0.0145434,-0.0401661,0.0079536,0.0099160,0.0012775,-0.0463804,0.0289844,-0.0287246,-0.0276947,0.0417971,0.0175378,-0.0046902,-0.0048551,0.0175770,0.0281937,0.0343526,0.0046811,0.0343136,0.0360961,0.0537720,0.0255655,-0.0259420,-0.0354685