  INSERT INTO projects (experience_id, name, description, objective, problem, solution, results, impact, stack, start_date, end_date, duration_months, collaborators, project_type, embedding) VALUES (exp_id_3, 'VGI4BIO - Outil d''analyse gospatiale dynamique', 'Dvelopper solution d''analyse gospatiale dynamique intgrant Spatial OLAP (Saiku) + visualisation cartographique (Feature Analyzer) pour l''Observatoire Agricole de la Biodiversit.', 'Permettre l''analyse gospatiale des observations de pratique agricole rcoltes via l''OAB avec l''outil Feature Analyzer. Dmonstration de faisabilit outil analyse gospatiale dynamique.', 'Analyses spatiales statiques ralises manuellement (Excel + QGIS). Pas de capacit d''exploration dynamique multidimensionnelle. Croisements complexes (rgion  anne  pratique  espce) laborieux.', 'Data Warehouse Spatial : PostgreSQL + PostGIS, Mondrian (moteur OLAP), Saiku (interface analyse OLAP). Dimensions OLAP : Rgion, Anne, Type pratique agricole, Espce pollinisatrice. ETL & Nettoyage : Pipeline Talend sur ~500 000 lignes (nettoyage doublons, validation golocalisation, standardisation formats, construction table de faits, agrgations spatiales). Calculs Gospatiaux (Java) : Gnration polygones rgions, Diagrammes proportionnels dynamiques, Positionnement gographique automatique. Intgration Feature Analyzer : Patch Feature Analyzer, Bouton connecteur Saiku  Feature Analyzer, Visualisation carte interactive avec polygones, diagrammes, filtres interactifs, drill-down spatial.', 'En tant capable d''analyser les observations collectes avec les dimensions gospatiales, l''analyse est devenue dynamique et les benchmarks rendus possibles. Publication scientifique validant l''approche.', 'Autonomie analystes : Scientifiques/animateurs OAB peuvent explorer donnes sans comptences techniques pousses. Analyses complexes facilites : Croisements multidimensionnels en quelques clics. Dcouverte patterns : Identification corrlations pratiques agricoles  prsence/abondance pollinisateurs. Dcisions claires : Support politique agricole environnementale. volution mthodologique : Excel/QGIS statique  SOLAP dynamique interactif. Scalabilit : Architecture supporte monte en charge donnes. Reproductibilit : Approche applicable autres observatoires biodiversit. Contribution recherche applique nationale.', 'PostgreSQL, PostGIS, Mondrian, Saiku, Talend, Java, SQL, Python, Feature Analyzer', '2018-09-01', '2019-05-31', 9, '2 informaticiens IRSTEA (INRAE Clermont-Ferrand) : Experts Spatial OLAP + Feature Analyzer, 2 scientifiques/animateurs OAB (MNHN) : Experts programme + donnes biodiversit', 'R&D', '[0.0027552,-0.0472863,0.0213740,-0.0143886,-0.0098868,-0.0116443,0.0217140,-0.0264773,-0.0110220,0.0062152,0.0092234,-0.0159175,-0.0444106,-0.0191654,-0.0690065,-0.0052254,-0.0029281,-0.0087560,0.0157481,0.0189150,-0.0549857,0.0103147,-0.0159629,-0.0373967,-0.0202025,-0.0483697,-0.0218997,0.0260752,-0.0091695,-0.0242171,-0.0189733,0.0197805,-0.0348993,-0.0454855,-0.0481941,-0.0280304,0.0289096,-0.0466812,-0.0135865,-0.0242485,0.0118277,-0.0247526,0.0206549,-0.0114323,0.0020528,0.0495121,0.0196215,-0.0141540,-0.0114808,-0.0228102,0.0061380,-0.0197353,0.0509765,0.0269804,0.0424456,0.0331881,0.0091298,0.0479002,0.0394584,0.0318527,-0.0424078,-0.0262411,0.0100969,0.0220576,-0.0310021,-0.0009178,0.0257211,0.0192691,0.0453925,-0.0553659,-0.0555459,-0.0222462,0.0120319,-0.0066601,0.0394707,-0.0244618,-0.0140824,-0.0301039,-0.0661773,-0.0566431,0.0355567,0.0126219,-0.0479381,0.0153365,-0.0699425,-0.0240604,-0.0457154,0.0191946,0.0414049,-0.0044154,-0.0147992,0.0328829,0.0119897,0.0020816,0.0235695,0.0445043,-0.0233862,-0.0056260,0.0125726,0.0253350,0.0090474,-0.0436122,-0.0389074,0.0007562,-0.0113114,-0.0360844,-0.0140500,0.0041350,-0.0447799,0.0299960,0.0180711,-0.0194937,0.0217433,0.0068279,0.0454728,-0.0372700,0.0382560,0.0034986,-0.0010752,-0.0201855,-0.0154823,-0.0320166,0.0180146,-0.0170482,0.0494258,0.0464938,-0.0405629,-0.0183539,-0.0383361,0.016