  INSERT INTO projects (experience_id, name, description, objective, problem, solution, results, impact, stack, start_date, end_date, duration_months, collaborators, project_type, embedding) VALUES (exp_id_5, 'HEADWORK - Plateforme de crowdsourcing optimise', 'Dveloppement d''un algorithme de matching comptence utilisateur  difficult tche pour optimiser la validation collaborative des identifications d''insectes pollinisateurs.', 'Valider une stratgie d''tiquetage pour rendre les photos collectes sur la plateforme de Suivi Photographique des Insectes Pollinisateurs plus exploitable par les scientifiques en crant une sous-plateforme participative de validation des identifications des espces sur chaque photo. Acclrer validation crowdsourcing via optimisation allocation tches.', 'Accumulation massive de photos non identifies suite au succs du programme SPIPOLL. Besoin d''acclrer le processus de validation.', 'valuation comptences utilisateur : Calcul bas sur historique (Nombre de participations, Taux de bonnes identifications, Diversit d''espces identifies correctement). valuation difficult tches : Raret de l''espce, Qualit de la photo, Similarit avec autres espces, tat de la tche (nombre de validations dj prsentes : 0/1/2 sur 3 requises), Premires suggestions d''identification. Algorithme de matching : Type Scoring/Ranking, Combinaison comptence user  difficult photo, Prise en compte rgle de validation (3 validations requises par photo), Calcul score de pertinence pour chaque couple (utilisateur, photo), Mise  jour comptences par batch sur fentre temporelle dfinie. Modles Predictive pour prdire justesse identifications : SVM, Random Forest, MLP, Rgression Linaire ; features historique utilisateur + qualit/raret photo. Plateforme ddie hors SPIPOLL mais connecte aux donnes SPIPOLL.', 'La performance du taux de validation de photos a t amliore de 10%, la prcision des identifications augmente de 7% et une meilleure comprhension des facteurs de mobilisation des participants  faire des validations. Exprimentation terrain 2 semaines, ~10 participants. Protocole scientifique : 2 stratgies testes (Stratgie existante SPIPOLL : libre choix photos par participants, Stratgie HEADWORK : recommandation via algorithme comptence/difficult). Mtriques : Taux de validation, Prcision des identifications, Facteurs de mobilisation participants. 2 publications scientifiques.', 'Amlioration significative apporte par le crowdsourcing concernant la participation. Approche IA rplicable pour les observatoires citoyens / citizen science. Approche rplicable autres observatoires biodiversit.', 'Python, Machine Learning (scikit-learn : SVM, Random Forest), Deep Learning (MLP), Recommender Systems, A/B Testing, Predictive Modeling, PHP, JavaScript, MySQL', '2020-01-01', '2021-07-31', 19, 'DRUID (Laboratoire IRISA Rennes) : recherche algorithmes, CESCO (quipe MNHN) : expertise scientifique biodiversit', 'R&D', '[0.0252526,-0.0523409,0.0366640,0.0104834,-0.0027239,-0.0020973,0.0478286,-0.0401576,-0.0441081,0.0042197,0.0421963,-0.0424215,-0.0326343,-0.0177332,-0.0111192,0.0006882,0.0085732,-0.0110587,0.0698935,0.0244847,-0.0340131,-0.0505668,0.0138343,-0.0280150,-0.0540083,0.0095076,-0.0056936,0.0418565,-0.0198608,0.0043459,-0.0098869,-0.0147845,0.0029510,0.0057341,0.0052255,0.0024968,-0.0137759,-0.0488993,-0.0489131,-0.0172756,-0.0418697,-0.0409533,0.0004591,-0.0245381,0.0072444,0.0229268,-0.0098919,-0.0066621,-0.0024259,-0.0631431,0.0120863,0.0062589,0.0150331,-0.0032770,-0.0033325,0.0139050,-0.0340394,0.0099610,-0.0111892,-0.0055000,-0.0193121,-0.0068498,0.0166490,0.0089889,0.0046371,0.0231433,0.0334317,0.0177562,0.0112304,-0.0153963,-0.0191507,0.0182942,0.0006107,-0.0047011,0.0220330,0.0068131,0.0004040,-0.0568026,-0.0567530,0.0038884,0.0202603,0.0030450,0.0169945,-0.0056938,-0.0255130,-0.0245351,-0.0110446,-0.0052118,0.0753547,-0.0141169,-0.0125765,-0.0535648,0.0576410,0.0210457,-0.0109104,0.0037993,0.0065297,-0.0329945,0.0319040,0.0634880,0.0016692,-0.0184398