  INSERT INTO projects (experience_id, name, description, objective, problem, solution, results, impact, stack, start_date, end_date, duration_months, collaborators, project_type, embedding) VALUES (exp_id_6, 'GE Healthcare - Analyse logs imagerie mdicale', 'Automatiser progressivement l''analyse de logs issus des tests automatiques (0-150 occurrences/jour, 1k-100k lignes logs/occurrence). Suite de POC R&D validant faisabilit automatisation ML/NLP en environnement industriel dynamique.', 'Automatiser progressivement l''analyse d''occurrences via ML. Dmontrer faisabilit automatisation extraction d''informations, cration de prototypes.', 'Volume massif de logs  analyser manuellement pour identifier les spcialistes concerns et clturer les incidents remonts. Process initial : extraction manuelle lignes pertinentes via Notepad.', 'Anne 0-1 (Analyse Manuelle + Structuration Donnes) : Analyse manuelle (Outil Notepad, Extraction lignes pertinentes, Volume 1-20 occ/jour dbut  0 occ fin semaine anne 1, Monte en comptence mtier + patterns rcurrents), Automatisation progressive (Scripts Python recherches historique, Identification occurrences dj vues, Recherche similarits cas passs), Structuration donnes (Base MySQL : Historique occurrences + logs extraits + PRs utiliss, Objectif acclration traitement via recherche similarits). Anne 1-2 (Premier POC ML - Classification PR) : Objectif (Prdire automatiquement quel PR correspond  une nouvelle occurrence), Approche (Donnes d''entranement historique MySQL occurrences classifies, Focus patterns occurrences pas encore les logs, Regroupement intelligent : collaboration spcialistes, comprhension fine PRs, regroupement PRs similaires + types d''occurrences, Modle ML : TF-IDF + Random Forest, Innovation : Stratgie d''entranement diffrente outil existant, Segmentation par type occurrence/PR regroups), Rsultats (Outil existant 80% prcision, POC 97% prcision, Limites : Non dployable production, Problme fondamental occurrences se ressemblent 