act : Acclration significative workflow analyse).', 'Gain temps 10-20 pour les analyses de premier niveau. Suite de POC R&D validant faisabilit automatisation ML/NLP en environnement industriel dynamique (multi-releases). Prototypes oprationnels pour l''quipe d''analyse Level 1. Base MySQL retaant l''historique  traitement 1-20 occ/jour  0 fin semaine. POC Classification ML : 97% prcision (vs 80% outil existant) pour prdiction PR. Pipeline extraction automatique : 150 occurrences traites  la fin de la journe.', 'Rduction drastique temps analyse. Automatisation extraction informations. Validation faisabilit ML industriel. Rpartition temps : 40% Data Engineering (ETL, pipelines, structuration donnes), 30% Data Analysis (Analyse logs, patterns, comprhension mtier), 30% Data Science (POC ML, prototypes, R&D).', 'Python, Polars (traitement donnes massives), scikit-learn (TF-IDF, Random Forest, SGDClassifier), Flask (API/interface), Docker, MySQL, SQL (requtes donnes), ETL pipelines (automatisation flux donnes), NLP, Apprentissage incrmental, Machine Learning industriel, TCL, Java, Git, Excel', '2022-04-01', '2025-12-31', 45, 'quipe GE Healthcare : Spcialistes Level 2, quipe Test Automation', 'R&D', '[0.0100797,-0.0525342,-0.0034317,-0.0252833,0.0086079,0.0121014,0.0342900,-0.0224381,-0.0242016,0.0312581,0.0133019,0.0224148,-0.0131766,-0.0103005,-0.0630840,-0.0092269,0.0220948,0.0167652,0.0084607,0.0264485,-0.0107098,0.0618978,0.0044955,0.0025662,-0.0010483,-0.0368368,0.0296130,0.0338020,-0.0124313,0.0137423,-0.0153956,0.0012855,-0.0309483,-0.0299064,-0.0130782,-0.0198670,-0.0091208,-0.0234880,-0.0703708,-0.0001644,-0.0320183,-0.0232306,-0.0209478,0.0079718,0.0324316,-0.0021265,0.0263650,0.0032314,-0.0256581,-0.0592788,0.0077918,-0.0466631,0.0298353,0.0552293,0.0139058,-0.0281932,-0.0494118,0.0134570,0.0275979,-0.0108684,0.0079782,0.0000366,0.0484680,0.0174515,-0.0023583,-0.0143321,0.0075398,0.0316392,-0.0052926,-0.0134082,-0.0053931,0.0442551,0.0373344,0.0079677,0.056964